  constructor(props){
    super(props);
    this.state = { products:[], filteredProducts: [], }
  }
  render() {
    return (
      <div className="Container">
        <h1>Hemlok Sports</h1>
        <hr/>
      <div className="row">
        <div className="col-md-8">
          <Products products={this.state.filteredProducts} handleAddToCart={this.handleAddToCart}/>
        </div>
        <div className="col-md-4">

        </div>
      </div>

      </div>
    );
  }
}

export default App;
